import searchForm from "./SearchForm";


const onSearchDataHandler = (data) => {
    enteredData = data
}

const retrieveDataHandler = (summoner_name, region, riotAPIKey) => {
    summoner_name = enteredData.user
    region = enteredData.region
    riotAPIKey = "RGAPI-66e7cf60-65b9-4d51-a9cd-5ccadc9cb5e9"

    fetch(
        `https://oc1.api.riotgames.com/lol/summoner/v4/summoners/by-name/${summoner_name}?api_key=${RIOT_API_KEY}`,
        {
          accept: {
            "Content-Type": "application/json",
          },
        }
      )
        .then((response) => response.json())
        .then((json) => console.log(json));
};


const retrieveData = (props) => {
    return (
        <>
        <searchForm onSaveSearch={onSearchDataHandler} />
        <div>{retrieveDataHandler}</div>
        </>
        
    );
}


export default getOpggUrl;
